<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Варвара Степановна Прохорова родится одиннадцатого апреля 2036. <br><p>Четвертого октября 1974 устроится на работу в Фонд на должность парикмахера. </p><p>	Окончательно уволится восьмого апреля 2769. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
